input = ''

def main():
    global input

    print(len(input))
    i = 0
    while i < len(input) - 1:
        c1 = input[i]
        c2 = input[i + 1]

        if c1.lower() == c2.lower() and c1 != c2:
            input = input[:i] + input[i + 2:]
            if i > 0:
                i -= 1
        else:
            i += 1

    print(len(input))

main()
